                reader.onload = function(e) {
                    $('#imgAvatar').attr('src', e.target.result);
                }

                reader.readAsDataURL(input.files[0]);
            }
        }

        $(""#UserAvatar"").change(function() {
            readURL(this);
        });
    </script>
